import React, { useState, useEffect } from 'react';
import { useSearchParams, useNavigate } from 'react-router-dom';
import './DrinkDiagram.css';
import Navbar from '../components/Navbar';
import UserInfoModal from '../components/UserInfoModal';

// A simple ring diagram component using an SVG circle.
function RingDiagram({ percentage }) {
  const radius = 60;
  const circumference = 2 * Math.PI * radius;
  const offset = circumference - (percentage / 100) * circumference;

  return (
    <svg width="150" height="150" className="ring-diagram">
      <circle
        className="ring-background"
        stroke="#eee"
        strokeWidth="12"
        fill="transparent"
        r={radius}
        cx="75"
        cy="75"
      />
      <circle
        className="ring-progress"
        stroke="#3f51b5"
        strokeWidth="12"
        fill="transparent"
        r={radius}
        cx="75"
        cy="75"
        strokeDasharray={circumference}
        strokeDashoffset={offset}
      />
      <text x="75" y="80" textAnchor="middle" fontSize="20" fill="#333">
        {percentage}%
      </text>
    </svg>
  );
}

export default function DrinkDiagram() {
  const [searchParams] = useSearchParams();
  const drinkName = searchParams.get('drink') || '';
  const [drinkDetail, setDrinkDetail] = useState(null);
  const [userInfoModalOpen, setUserInfoModalOpen] = useState(false);
  const [allowedPercentage, setAllowedPercentage] = useState(0);
  const navigate = useNavigate();

  // Get user from localStorage
  const storedUser = localStorage.getItem('bacshotsUser');
  let user = storedUser ? JSON.parse(storedUser) : null;

  // Fetch drink details from the backend by drink name.
  useEffect(() => {
    if (drinkName) {
      async function fetchDrinkDetail() {
        try {
          const res = await fetch(`/drinks?name=${encodeURIComponent(drinkName)}`, { credentials: 'include' });
          if (res.ok) {
            const data = await res.json();
            // If endpoint returns an array, pick the first match.
            if (Array.isArray(data) && data.length > 0) {
              setDrinkDetail(data[0]);
            } else if (!Array.isArray(data)) {
              setDrinkDetail(data);
            }
          } else {
            console.error('Failed to fetch drink details:', res.status);
          }
        } catch (err) {
          console.error('Error fetching drink details:', err);
        }
      }
      fetchDrinkDetail();
    }
  }, [drinkName]);

  // Calculate allowed percentage using a modified formula.
  // (This is a placeholder formula—you can replace it with your own logic.)
  useEffect(() => {
    if (!user || !user.weight || !user.sex) {
      setUserInfoModalOpen(true);
      return;
    }
    if (drinkDetail && drinkDetail.abv) {
      const weightFactor = user.weight / 150; // baseline weight
      const sexFactor = user.sex === 'male' ? 1 : 0.8;
      const constant = 50; // arbitrary constant for scaling
      const calc = Math.round(100 * (weightFactor * sexFactor * constant / drinkDetail.abv));
      setAllowedPercentage(Math.min(100, calc));
    }
  }, [user, drinkDetail]);

  // Callback to update user info if missing.
  const handleUserInfoUpdate = (newUserData) => {
    user = { ...user, ...newUserData };
    localStorage.setItem('bacshotsUser', JSON.stringify(user));
    setUserInfoModalOpen(false);
    if (drinkDetail && drinkDetail.abv) {
      const weightFactor = user.weight / 150;
      const sexFactor = user.sex === 'male' ? 1 : 0.8;
      const constant = 50;
      const calc = Math.round(100 * (weightFactor * sexFactor * constant / drinkDetail.abv));
      setAllowedPercentage(Math.min(100, calc));
    }
  };

  return (
    <div className="drink-diagram-container">
      <Navbar onSignOut={() => {
        localStorage.removeItem('bacshotsUser');
        window.location.href = '/signin';
      }} />
      <div className="drink-diagram-content">
        <h1>Tonight, you're drinking:</h1>
        <h2 className="drink-name">{drinkName}</h2>
        <RingDiagram percentage={allowedPercentage} />
        <button className="back-btn" onClick={() => navigate('/im-drinking')}>
          Back
        </button>
      </div>
      {userInfoModalOpen && <UserInfoModal onClose={handleUserInfoUpdate} />}
    </div>
  );
}
